// SPDX-License-Identifier: MIT
pragma solidity 0.8.3;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./interface/IRandom.sol";
import "./interface/IPool.sol";
import "./lib/Clones.sol";

contract PoolFactory is Ownable {

    event PoolCreated(address pool, uint256 startDate, uint256 participationEndDate, uint256 endDate, uint256 poolCost);

    address public poolToken;
    address public tokenCompound;
    address public poolImplementation;
    IRandom private random;

    constructor(address _poolToken, address _tokenCompound, address _poolImplementation, address _random) {
        poolToken = _poolToken;
        tokenCompound = _tokenCompound;
        poolImplementation = _poolImplementation;
        random = IRandom(_random);
    }

    /**
     * createPool creates pool which integrate with compound's staking
     * _startDate is date of starting pool, from this date pool's functions enable
     * _participationEndDate is date after which the play function is not available
     * _endDate is date of pool's end, enable to choose winner after this date
     * _poolCost is required amount for participation
     */
    function createPool(uint256 _startDate, uint256 _participationEndDate, uint256 _endDate, uint256 _poolCost) onlyOwner external {
        address _pool = Clones.clone(poolImplementation);
        IPool(_pool).initialize(poolToken, tokenCompound, _startDate, _participationEndDate, _endDate, _poolCost);
        emit PoolCreated(_pool, _startDate, _participationEndDate, _endDate, _poolCost);
    }

    /**
     * play spends user money to compound mint
     * _pool is address of pool
     */
    function play(address _pool) external {
        random.regenerateHash();
        IPool(_pool).play(msg.sender);
    }

    /**
     * setWinner set pool's winner, redeem all assets from compound
     * _pool is address of pool
     */
    function setWinner(address _pool) external onlyOwner {
        IPool _ipool = IPool(_pool);
        _ipool.setWinner(random.rand(_ipool.getUsersListLength()));
    }

    /**
     * claim transfer asset from selt to user, winner also receive additional reward
     * _pool is address of pool
     */
    function claim(address _pool) external {
        random.regenerateHash();
        IPool(_pool).claim(msg.sender);
    }
}
